import React, { useState } from "react";
const [bgcolor, setBgcolor] = useState("white");

const DarkLight = () => {
  return (
    <div className="row" style={{ backgroud: `${bgcolor}` }}>
      <div className="col-md-12  d-flex  justify-content-center text-white  align-items-center">
        <button
          className="btn btn-basic"
          onClick={() => {
            setBgcolor("white");
          }}
        >
          Light
        </button>
        <button
          className="btn btn-basic"
          onClick={() => {
            setBgcolor("black");
          }}
        >
          Dark
        </button>
      </div>
    </div>
  );
};

export default DarkLight;
